import React from 'react';
import {Link} from "react-router-dom";
import '../../App';

const Navbar = () =>{
    return (
        <nav className="main-navbar bg-main">
            <h2><Link href>YourPartner</Link></h2>
        </nav>
    );
};

export default Navbar;
